import React from 'react'
import {Navbar, Form, Button, Nav, FormControl} from 'react-bootstrap';
import { LinkContainer } from "react-router-bootstrap";
import { FiSearch} from "react-icons/fi";
import FeedCard from "../Components/FeedCard";
import { Input } from 'semantic-ui-react'

const description = [
  'Amy is a violinist with 2 years experience in the wedding industry.',
  'She enjoys the outdoors and currently resides in upstate New York.',
].join(' ')


const Home = () => {
    return (
        <div>
    <Navbar bg="primary" variant="dark" fixed="top">
        <Navbar.Brand href="#home" className="pr-3">MatchMe</Navbar.Brand>
        <Nav className="mr-auto">
          <LinkContainer to="/feed">
            <Nav.Link >Actions</Nav.Link>
          </LinkContainer>
          <Nav.Link href="#Feed">Groups</Nav.Link>
        </Nav>
        {/* <Form inline>
          <FormControl type="text" placeholder="Search" className="mr-sm-2" />
          <Button variant="outline-light" style={{borderRadius: 10}}>
            <FiSearch size="22"/>
          </Button>


        </Form> */}
        <Input icon='search' placeholder='Search...'/>
        <Icon name="user circle" />
    </Navbar>
    <div style={{paddingTop: 100}}></div>
    <FeedCard description={description} likes={8}/>
        </div>

    );
}

export default Home;
